function App() {
  return (
    <Hearder />
  )
}

function Hearder() {
  return(
    <div>
        <header>
        <img className="imgLogo" src="./assets/logo.png"/>
        <div  className="searchBar">
            <input/>
            <img src="./assets/searchicon.png"/>
        </div>
        <div className="headerWriting">
            Mettre mon logement sur AirBnB
        </div>
    </header>
    </div>
  )

}

export default App;
